import React from "react";
import Card from "./Card";
import Ldata from "./Ldata";
const BackEnd = () => {
    return (
        <>
            <Card key={Ldata[1].id} images={Ldata[1].img} title={Ldata[1].title} type={Ldata[1].type} />
            <Card key={Ldata[2].id} images={Ldata[2].img} title={Ldata[2].title} type={Ldata[2].type} />
        </>
    )
}

export default BackEnd;
